// /src/pages/HomePage/HowItWorks.js
import React from "react";
import "../../styles/HomePage/HowItWorks.css";

const HowItWorks = () => {
  const steps = [
    { icon: "signup.png", text: "Sign up and create your profile" },
    { icon: "search.png", text: "Search doctors or hospitals" },
    { icon: "video-call.png", text: "Book appointment or video call" },
    { icon: "prescription.png", text: "Get your prescription online" },
  ];

  return (
    <section className="how-it-works">
      <h2>How It Works</h2>
      <div className="steps">
        {steps.map((step, index) => (
          <div className="step" key={index}>
            <img src={`/assets/HomePage/service-icons/${step.icon}`} alt={step.text} />
            <p>{step.text}</p>
          </div>
        ))}
      </div>
    </section>
  );
};

export default HowItWorks;
